(4, 'Tangki Panel', 'tangki-panel', 0, 0, '<p>Tangki Panel mempunyai fungsi yang sama seperti tangki silinder, perbedaanya adalah tangki panel mempunyai bentuk kotak menyesuaikan dengan ketersediaan ruang yang ada. Untuk Informasi lebih lanjut, silahkan hubung customer service kami.</p>', 1, 1, '2022-01-06 01:29:55', '2022-02-11 13:28:30'),
(5, 'Tangki Air', 'tangki-air', 0, 0, NULL, 1, 1, '2022-01-06 01:29:55', NULL),
(6, 'Septic Tank', 'septic-tank', 0, 0, '<p>Kaami menyediakan Septic Tank dengan berbagai macam ukuran , bentuk, warna sesuai dengan kebutuhan anda. Untuk informasi lebih lanjut silahkan hubungi customer service kami</p>', 1, 1, '2022-01-06 01:29:55', '2022-02-11 12:44:16'),
(7, 'Grease Trap', 'grease-trap', 0, 0, NULL, 1, 1, '2022-01-06 01:29:55', NULL),
(8, 'Water Slide', 'water-slide', 0, 0, '<p>Kami bisa membuat water lide dengan berbagai macam ukuran panjang, belokan, warna dan spesifikasi sesuai dengan kebutuhan anda. Untuk informasi lebih lanjut silahkan hubungi customer service kami.</p>', 1, 1, '2022-01-06 01:29:55', '2022-02-11 13:23:48'),
(9, 'Atap Fiber', 'atap-fiber', 0, 0, NULL, 1, 1, '2022-01-06 01:29:55', NULL),
(10, 'Kursi Salon', 'kursi-salon', 0, 0, '<p>Kami memproduksi berbagai macam ukuran, bentuk dan tipe kursi salon ntuk meningkatkan kenyamanan anda aat sedang berada di salon.Untuk informasi lebih lanjut, silahkan hubungi kami.</p>', 1, 1, '2022-01-06 01:29:55', '2022-02-11 11:34:27'),
