(28, 'Pipa', 'pipa', 0, 0, '<p>Kami dapat membuat berbagai macam pipa dari fiberglass untuk berbagai macam kebutuhan seperti untuk bahan kimia atau tekanan tinggi atau anti korosi dengan ukuran diamter dan ketebalan yang dapat disesuikan sesuai kebutuhan. Untuk informasi lebih lanjut silahkan hubungi Customer Service kami.</p>', 1, 1, '2022-01-06 01:29:56', '2022-02-11 13:08:37'),
(31, 'Chemical Tank', 'chemical-tank', 0, 0, '<p>Foto kami hanya sebagai referensi karena chemical tank dapat dibuat berbagai macam ukuran dan ketebalan sesuai dengan kebutuhan. Untuk informasi lebih lanjut silahkan hubungi customer service kami.</p>', 1, 1, '2022-01-06 01:29:56', '2022-02-11 13:13:10'),
(32, 'Bak Budidaya Pembibitan Ikan', 'bak-budidaya-pembibitan-ikan', 0, 0, '<p>Bak pembibitan ikan cocok untuk anda yang bergerak dibidang budidaya ikan ataupun untuk anda yang hobi memelihara ikan.Ukuran Dimensi panjang, lebar, tinggi dan ketebalan dapat disesuaikan dengan kebutuhan anda. Hubungi kami segera.&nbsp;</p>', 1, 1, '2022-01-06 01:29:56', '2022-02-11 13:21:07'),
(33, 'Bak Filter', 'bak-filter', 0, 0, '<p>Kami dapat membuat bak filter dengan berbagai macam ukuran, dan spesifikasi. Untuk informasi lebih lanjut silahkan hubungi customer service kami</p>', 1, 1, '2022-01-06 01:29:56', '2022-02-11 13:16:42'),
